 <span data-ttu-id="cff23-102">この列挙は、<xref:System.Windows.Forms.MessageBox> クラスで使用します。</span><span class="sxs-lookup"><span data-stu-id="cff23-102">This enumeration is used by the <xref:System.Windows.Forms.MessageBox> class.</span></span> <span data-ttu-id="cff23-103">この列挙体の各メンバーの説明には、シンボルの一般的な表現が含まれています。</span><span class="sxs-lookup"><span data-stu-id="cff23-103">The description of each member of this enumeration contains a typical representation of the symbol.</span></span> <span data-ttu-id="cff23-104">表示されている実際のグラフィックスは、オペレーティング システムの定数の関数です。</span><span class="sxs-lookup"><span data-stu-id="cff23-104">The actual graphic displayed is a function of the operating system constants.</span></span> <span data-ttu-id="cff23-105">現在の実装では、割り当てられている複数の値を含む 4 つの固有の記号です。</span><span class="sxs-lookup"><span data-stu-id="cff23-105">In current implementations there are four unique symbols with multiple values assigned to them.</span></span>  
  
   
  
## Examples  
 <span data-ttu-id="cff23-106">次のコード例を使用する方法を示しています、<xref:System.Windows.Forms.MessageBox>で不足しているエントリのユーザーに通知する、<xref:System.Windows.Forms.TextBox>します。</span><span class="sxs-lookup"><span data-stu-id="cff23-106">The following code example shows how to use a <xref:System.Windows.Forms.MessageBox> to inform the user of a missing entry in a <xref:System.Windows.Forms.TextBox>.</span></span> <span data-ttu-id="cff23-107">この例では、既存のフォームでからメソッドが呼び出されることが必要です、<xref:System.Windows.Forms.Button>と<xref:System.Windows.Forms.TextBox>にします。</span><span class="sxs-lookup"><span data-stu-id="cff23-107">This example requires that the method is called from an existing form with a <xref:System.Windows.Forms.Button> and a <xref:System.Windows.Forms.TextBox> on it.</span></span>  
  
```csharp  
private void Form1_FormClosing(object sender, FormClosingEventArgs e)  
{  
    const string message =  
        "Are you sure that you would like to close the form?";  
    const string caption = "Form Closing";  
    var result = MessageBox.Show(message, caption,  
                                 MessageBoxButtons.YesNo,  
                                 MessageBoxIcon.Exclamation);  
  
    // If the no button was pressed ...  
    if (result == DialogResult.No)  
    {  
        // cancel the closure of the form.  
        e.Cancel = true;  
    }  
}  
```  
  
```cpp  
private:  
   void Form1_FormClosing(Object^ sender, FormClosingEventArgs^ e)  
   {  
      // If the no button was pressed ...  
      if ((MessageBox::Show(  
         "Are you sure that you would like to close the form?",   
         "Form Closing", MessageBoxButtons::YesNo,   
         MessageBoxIcon::Exclamation) == DialogResult::No))  
      {  
         // cancel the closure of the form.  
         e->Cancel = true;  
      }  
   }  
```  
  
```vb  
Private Sub Form1_FormClosing( _  
    ByVal sender As System.Object, _  
    ByVal e As System.Windows.Forms.FormClosingEventArgs) _  
    Handles MyBase.FormClosing  
  
    Dim message As String = _  
            "Are you sure that you would like to close the form?"  
    Dim caption As String = "Form Closing"  
    Dim result = MessageBox.Show(message, caption, _  
                                 MessageBoxButtons.YesNo, _  
                                 MessageBoxIcon.Exclamation)  
  
    ' If the no button was pressed ...  
    If (result = DialogResult.No) Then  
        ' cancel the closure of the form.  
        e.Cancel = True  
    End If  
End Sub  
```  

